const assert = require('assert');
const {VerticalCalculator} = require('../dist/index.js');

const cal = new VerticalCalculator();

function itt(str, nodes) {
    const [numa, opt, numb] = str.split(' ');
    it(str, getTest(+numa, opt, +numb, nodes));
}

function getTest(numa, opt, numb, nodes) {
    return function () {
        const res = cal.generate(numa, opt, numb);
        const result = nodes; // eslint-disable-line
        assert.equal(res.code, 0);
        assert.deepEqual(res.nodes, result);
    };
}

